(90, 106, 15, 1, 1, 3, '', '{\"typeId\":\"15\",\"authorId\":null,\"title\":\"Education\",\"slug\":\"education\",\"postDate\":1535626020,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"72\":{\"114\":{\"type\":\"banner\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"bannerImage\":[\"120\"],\"bannerHeading\":\"Education at Elevation 2477\"}}},\"43\":{\"115\":{\"type\":\"heading\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"There are many kinds of narratives and organizing principles.\"}},\"116\":{\"type\":\"body\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"body\":\"<p>Science is driven by evidence gathered in experiments, and by the falsification of extant theories and their replacement with newer, asymptotically truer, ones. Other systems  religion, nationalism, paranoid ideation, or art  are based on personal experiences (faith, inspiration, paranoia, etc.).</p>\\r\\n<p>Experiential narratives can and do interact with evidential narratives and vice versa. For instance: belief in God inspires some scientists who regard science as a method to peek at Gods cards and to get closer to Him. Another example: the pursuit of scientific endeavors enhances ones national pride and is motivated by it. Science is often corrupted in order to support nationalistic and racist claims.</p>\"}},\"117\":{\"type\":\"heading\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"The basic units of all narratives\"}},\"118\":{\"type\":\"body\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"body\":\"<p>known by their effects on the environment. God, in this sense, is no different from electrons, quarks, and black holes. All four constructs cannot be directly observed, but the fact of their existence is derived from their effects.</p>\\r\\n<p>Granted, Gods effects are discernible only in the social and psychological (or psychopathological) realms. But this observed constraint doesnt render Him less real. The hypothesized existence of God parsimoniously explains a myriad ostensibly unrelated phenomena and, therefore, conforms to the rules governing the formulation of scientific theories.</p>\\r\\n<p>The locus of Gods hypothesized existence is, clearly and exclusively, in the minds of believers. But this again does not make Him less real. The contents of our minds are as real as anything out there. Actually, the very distinction between epistemology and ontology is blurred.</p>\"}}}}}', '2018-08-31 05:43:03', '2018-08-31 05:43:03', '17a80b03-c5cf-456e-90b5-a5bea61dbe2c'),
