(94, 122, 6, 1, 1, 1, '', '{\"typeId\":\"6\",\"authorId\":\"1\",\"title\":\"About\",\"slug\":\"about\",\"postDate\":null,\"expiryDate\":null,\"enabled\":false,\"newParentId\":\"\",\"fields\":{\"72\":{\"123\":{\"type\":\"banner\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"bannerImage\":[\"108\"],\"bannerHeading\":\"About Elevation 2477\"}}},\"43\":{\"124\":{\"type\":\"heading\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Compelling Header Here\"}},\"125\":{\"type\":\"body\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"body\":\"<p>A dispensary is as much about touching the lives of patients who seek palliative and alternative care through medical cannabis, as it is about establishing a sophisticated outlet for products of the highest quality and reputation in a region where there is no access.</p>\\r\\n<p>Elevation 2477 is in the business of creating a community hub of cannabis education that empowers people to make choices about what brings them relief and wellness. For us, it is an endeavor steeped in respect for the medicine and hope for the patients.</p>\\r\\n<p>Elevation 2477 will offer premium, craft medical cannabis and medical cannabis products as<br />permitted by law in California to qualifying local patients. Our company has high aspirations and wants to earn its right as a community centric healing and wellness establishment.</p>\"}}}}}', '2018-08-31 06:25:20', '2018-08-31 06:25:20', '1b314412-1918-4041-823c-d0e28762aa0a'),
