 new knowledge gained by experimentation. Our current scientific theories will be replaced by newer, truer theories. But any and all future scientific theories will be falsifiable and testable.</p>\\r\\n<p>Knowledge and belief are like oil and water. They dont mix. Knowledge doesnt lead to belief and belief does not yield knowledge. Belief can yield conviction or strongly-felt opinions. But belief cannot result in knowledge.</p>\\r\\n<p>Still, both known things and believed things exist. The former exist out there and the latter in our minds and only there. But they are no less real for that.</p>\"}}}}}', '2018-08-31 06:55:56', '2018-08-31 06:55:56', '71cbf3a7-afe8-4c25-b41e-3e5e6d49e865'),
