n the existence of believers.</p>\\r\\n<p>We know that the Sun exists. We dont know that God exists. We believe that God exists  but we dont and cannot know it, in the scientific sense of the word. We can design experiments to falsify (prove wrong) the existence of electrons, quarks, and black holes (and, thus, if all these experiments fail, prove that electrons, quarks, and black holes exist). We can also design experiments to prove that electrons, quarks, and black holes exist. But we cannot design even one experiment to falsify the existence of a God who is outside the minds of believers (and, thus, if the experiment fails, prove that God exists out there). Additionally, we cannot design even one experiment to prove that God exists outside the minds of believers. What about the argument from design? The universe is so complex and diverse that surely it entails the existence of a supreme intelligence, the worlds designer and creator, known by some as God. On the other hand, the worlds richness and variety can be fully accounted for using modern scientific theories such as evolution and the big bang. There is no need to introduce God into the equations.</p>\\r\\n<p>Still, it is possible that God is responsible for it all. The problem is that we cannot design even one experiment to falsify this theory, that God created the Universe (and, thus, if the experiment fails, prove that God is, indeed, the worlds originator). Additionally, we cannot design even one experiment to prove that God created the world. We can, however, design numerous experiments to falsify the scientific theories that explain the creation of the Universe (and, thus, if these experiments fail, lend these theories substantial support). We can also design experiments to prove the scientific theories that explain the creation of the Universe. It does not mean that these theories are absolutely true and immutable. They are not. Our current scientific theories are partly true and are bound to change with new knowledge gained by experimentation. Our current scientific theories will be replaced by newer, truer theories. But any and all future scientific theories will be falsifiable and testable.</p>\\r\\n<p>Knowledge and belief are like oil and water. They dont mix. Knowledge doesnt lead to belief and belief does not yield knowledge. Belief can yield conviction or strongly-felt opinions. But belief cannot result in knowledge.</p>\\r\\n<p>Still, both known things and believed things exist. The former exist out there and the latter in our minds and only there. But they are no less real for that.</p>\"}}},\"76\":[\"210\"]}}', '2018-09-01 06:17:42', '2018-09-01 06:17:42', '8f8d6991-4b00-4ce2-8122-61748ad45429'),
