(143, 46, 4, 1, 1, 5, '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Outdoor Cannabis Educational Series 2\",\"slug\":\"outdoor-cannabis-educational-series-2\",\"postDate\":1535442840,\"expiryDate\":null,\"enabled\":true,\"newParentId\":null,\"fields\":{\"26\":[\"26\"],\"60\":[\"37\"],\"28\":\"Fri Aug 21 - Sat Aug 24, 2018\",\"27\":\"Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore.\",\"61\":\"Elevation 2477, Nevada City Campus\",\"43\":{\"47\":{\"type\":\"heading\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"There are many kinds of narratives and organizing principles.\"}},\"48\":{\"type\":\"body\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"body\":\"<p>Science is driven by evidence gathered in experiments, and by the falsification of extant theories and their replacement with newer, asymptotically truer, ones. Other systems  religion, nationalism, paranoid ideation, or art  are based on personal experiences (faith, inspiration, paranoia, etc.).</p>\\r\\n<p>Experiential narratives can and do interact with evidential narratives and vice versa. For instance: belief in God inspires some scientists who regard science as a method to peek at Gods cards and to get closer to Him. Another example: the pursuit of scientific endeavors enhances ones national pride and is motivated by it. Science is often corrupted in order to support nationalistic and racist claims.</p>\"}},\"49\":{\"type\":\"heading\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"The basic units of all narratives\"}},\"50\":{\"type\":\"body\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"body\":\"<p>known by their effects on the environment. God, in this sense, is no different from electrons, quarks, and black holes. All four constructs cannot be directly observed, but the fact of their existence is derived from their effects.</p>\\r\\n<p>Granted, Gods effects are discernible only in the social and psych