(159, 122, 6, 1, 1, 3, '', '{\"typeId\":\"6\",\"authorId\":\"1\",\"title\":\"About\",\"slug\":\"about\",\"postDate\":1535696760,\"expiryDate\":null,\"enabled\":true,\"newParentId\":\"\",\"fields\":{\"72\":{\"123\":{\"type\":\"banner\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"image\":[\"108\"],\"heading\":\"About Elevation 2477\"}}},\"43\":{\"124\":{\"type\":\"heading\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Compelling Header Here\"}},\"125\":{\"type\":\"body\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"body\":\"<p>A dispensary is as much about touching the lives of patients who seek palliative and alternative care through medical cannabis, as it is about establishing a sophisticated outlet for products of the highest quality and reputation in a region where there is no access.</p>\\r\\n<p>Elevation 2477 is in the business of creating a community hub of cannabis education that empowers people to make choices about what brings them relief and wellness. For us, it is an endeavor steeped in respect for the medicine and hope for the patients.</p>\\r\\n<p>Elevation 2477 will offer premium, craft medical cannabis and medical cannabis products as<br />permitted by law in California to qualifying local patients. Our company has high aspirations and wants to earn its right as a community centric healing and wellness establishment.</p>\"}}},\"76\":[\"210\"]}}', '2018-09-03 08:30:10', '2018-09-03 08:30:10', 'df8e895b-d912-4bb2-abc4-781982b41742'),
(161, 105, 6, 1, 1, 4, '', '{\"typeId\":\"6\",\"authorId\":\"1\",\"title\":\"Terms & Conditions\",\"slug\":\"terms-conditions\",\"postDate\":1535625840,\"expiryDate\":null,\"enabled\":true,\"newParentId\":\"\",\"fields\":{\"72\":{\"207\":{\"type\":\"banner\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"image\":[\"108\"],\"heading\":\"Terms & Conditions of Elevation 2477\"}}},\"43\":{\"208\":{\"type\":\"heading\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"heading\":\"Where can I get some?\"}},\"209\":{\"type\":\"body\",\"enabled\":true,\"collapsed\":false,\"fields\":{\"body\":\"<p>Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \\\"de Finibus Bonorum et Malorum\\\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \\\"Lorem ipsum dolor sit amet..\\\", comes from a line in section 1.10.32.</p>\\r\\n<p>The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from \\\"de Finibus Bonorum et Malorum\\\" by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.<br /><br />The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from \\\"de Finibus Bonorum et Malorum\\\" by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.<br /></p>\"}}},\"76\":[\"210\"]}}', '2018-09-03 09:15:24', '2018-09-03 09:15:24', 'd260a6d0-2753-4c07-bbe9-42d238788efd');
