(26, 125, 1, '2018-08-31 06:25:19', '2018-09-03 08:30:09', 'd8d2d14a-e7f4-4499-8b70-6150e656c2f8', NULL, '<p>A dispensary is as much about touching the lives of patients who seek palliative and alternative care through medical cannabis, as it is about establishing a sophisticated outlet for products of the highest quality and reputation in a region where there is no access.</p>\r\n<p>Elevation 2477 is in the business of creating a community hub of cannabis education that empowers people to make choices about what brings them relief and wellness. For us, it is an endeavor steeped in respect for the medicine and hope for the patients.</p>\r\n<p>Elevation 2477 will offer premium, craft medical cannabis and medical cannabis products as<br />permitted by law in California to qualifying local patients. Our company has high aspirations and wants to earn its right as a community centric healing and wellness establishment.</p>', NULL, NULL),
