(182, 'field', 43, 1, ' there are many kinds of narratives and organizing principles science is driven by evidence gathered in experiments and by the falsification of extant theories and their replacement with newer asymptotically truer ones other systems religion nationalism paranoid ideation or art are based on personal experiences faith inspiration paranoia etc experiential narratives can and do interact with evidential narratives and vice versa for instance belief in god inspires some scientists who regard science as a method to peek at god s cards and to get closer to him another example the pursuit of scientific endeavors enhances one s national pride and is motivated by it science is often corrupted in order to support nationalistic and racist claims the basic units of all narratives known by their effects on the environment god in this sense is no different from electrons quarks and black holes all four constructs cannot be directly observed but the fact of their existence is derived from their effects granted god s effects are discernible only in the social and psychological or psychopathological realms but this observed constraint doesn t render him less real the hypothesized existence of god parsimoniously explains a myriad ostensibly unrelated phenomena and therefore conforms to the rules governing the formulation of scientific theories the locus of god s hypothesized existence is clearly and exclusively in the minds of believers but this again does not make him less real the contents of our minds are as real as anything out there actually the very distinction between epistemology and ontology is blurred guy smartypants but is god s existence true or is he just a figment of our neediness and imagination truth is the measure of the ability of our models to describe phenomena and predict them god s existence in people s minds succeeds to do both for instance assuming that god exists allows us to predict many of the behaviors of people who profess to believ