 cannot design even one experiment to falsify this theory that god created the universe and thus if the experiment fails prove that god is indeed the world s originator additionally we cannot design even one experiment to prove that god created the world we can however design numerous experiments to falsify the scientific theories that explain the creation of the universe and thus if these experiments fail lend these theories substantial support we can also design experiments to prove the scientific theories that explain the creation of the universe it does not mean that these theories are absolutely true and immutable they are not our current scientific theories are partly true and are bound to change with new knowledge gained by experimentation our current scientific theories will be replaced by newer truer theories but any and all future scientific theories will be falsifiable and testable knowledge and belief are like oil and water they don t mix knowledge doesn t lead to belief and belief does not yield knowledge belief can yield conviction or strongly felt opinions but belief cannot result in knowledge still both known things and believed things exist the former exist out there and the latter in our minds and only there but they are no less real for that '),
