(21, 1, 'pages', NULL, '2018-09-04 08:31:33', '        <div id=\"mainContent\">\n        <div class=\"topo-map\"></div>\n        <div class=\"overlay-bg\"></div>\n                    <section id=\"hero\" class=\"inverse basic\" style=\"background-image: url(\'http://elevation.local/assets/uploads/temp-render-front.jpg\')\" >\n                <div class=\"grid-container grid-x grid-padding-x \">\n                    <div class=\"cell \">\n                        <div class=\"entry-details entry-header-content inverse text-center\">\n                            <h1>Privacy Policy of Elevation 2477</h1>                        </div>\n                    </div>\n                </div>\n            </section>\n                <section id=\"entry-content\">\n            <div class=\"grid-container grid-x grid-padding-x\">\n                <div class=\"cell large-8 large-offset-2\">\n                                            <div class=\"news-entry\">\n                            <h3>Where does it come from?</h3>                                                    </div>\n                                            <div class=\"news-entry\">\n                                                        <p><p>Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.</p>\r\n<p>The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from \"de Finibus Bonorum et Malorum\" by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.</p></p>                        </div>\n                                    </div>\n                <!-- /.cell -->\n\n            </div>\n            <!--/.container -->\n        </section>\n\n        <section id=\"promo\">\n            <div class=\"grid-container grid-x grid-padding-x\">\n                <div class=\"cell medium-8 large-6 medium-offset-2 large-offset-3\">\n                                            <div class=\"promo\">\n                            <img src=\"http://elevation.local/assets/uploads/temp-promo.jpg\" alt=\"Temp Promo\">\n                        </div>\n                                    </div>\n            </div>\n        </section>\n    '),
