(23, 1, 'education', NULL, '2018-09-04 09:32:17', '        <div class=\"topo-map\"></div>\n        <div class=\"overlay-bg\"></div>\n                    <section id=\"hero\" class=\"inverse basic\" style=\"background-image: url(\'http://elevation.local/assets/uploads/temp-education-photo.jpg\')\" >\n                <div class=\"grid-container grid-x grid-padding-x \">\n                    <div class=\"cell \">\n                        <div class=\"entry-details entry-header-content inverse text-center\">\n                           <h1>Education at Elevation 2477</h1>                        </div>\n                    </div>\n                </div>\n            </section>\n                <section id=\"entry-content\">\n            <div class=\"grid-container grid-x grid-padding-x\">\n                <div class=\"cell large-8\">\n                                            <div class=\"news-entry\">\n                             <h3>There are many kinds of narratives and organizing principles.</h3>                            <p></p>\n                        </div>\n                                            <div class=\"news-entry\">\n                                                         <p><p><p>Science is driven by evidence gathered in experiments, and by the falsification of extant theories and their replacement with newer, asymptotically truer, ones. Other systems  religion, nationalism, paranoid ideation, or art  are based on personal experiences (faith, inspiration, paranoia, etc.).</p>\r\n<p>Experiential narratives can and do interact with evidential narratives and vice versa. For instance: belief in God inspires some scientists who regard science as a method to peek at Gods cards and to get closer to Him. Another example: the pursuit of scientific endeavors enhances ones national pride and is motivated by it. Science is often corrupted in order to support nationalistic and racist claims.</p></p></p>\n                        </div>\n                                            <div class=\"news-entry\">\n                             <h3>The basic units of all narratives</h3>                            <p></p>\n                        </div>\n                                            <div class=\"news-entry\">\n                                                         <p><p><p>known by their effects on the environment. God, in this sense, is no different from electrons, quarks, and black holes. All four constructs cannot be directly observed, but the fact of their existence is derived from their effects.</p>\r\n<p>Granted, Gods effects are discernible only in the social and psychological (or psychopathological) realms. But this observed constraint doesnt render Him less real. The hypothesized existence of God parsimoniously explains a myriad ostensibly unrelated phenomena and, therefore, conforms to the rules governing the formulation of scientific theories.</p>\r\n<p>The locus of Gods hypothesized existence is, clearly and exclusively, in the minds of believers. But this again does not make Him less real. The contents of our minds are as real as anything out there. Actually, the very distinction between epistemology and ontology is blurred.</p></p></p>\n                        </div>\n                                    </div>\n                <!-- /.cell -->\n                <div class=\"cell large-4 right\">\n    <div class=\"sidebar\">\n        <div class=\"module educators\">\n            <div class=\"module-header\">\n                <div class=\"grid-x card-header\">\n                    <div class=\"cell auto\">\n                        <h3>Educators</h3>\n                    </div>\n                    <div class=\"cell shrink text-right\">\n                        <a href=\"/education\" class=\"more\">All Educators</a>\n                    </div>\n                </div>\n            </div>\n                            <div class=\"educator p1\">\n                    <div class=\"grid-x\">\n                        <div class=\"cell small-5 photo\" style=\"background-image: url(\'http://elevation.local/assets/uploads/temp-educator-dee.jpg\')\" >\n                        </div>\n                        <div class=\"cell small-7\">\n                            <div class=\"card-section\">\n                                 <h4>Dee Dussualt</h4>\n                                <p>Yoga &amp; Tantra Teacher</p>                            </div>\n                        </div>\n                    </div>\n                </div>\n                            <div class=\"educator p2\">\n                    <div class=\"grid-x\">\n                        <div class=\"cell small-5 photo\" style=\"background-image: url(\'http://elevation.local/assets/uploads/temp-render-front.jpg\')\" >\n                        </div>\n                        <div class=\"cell small-7\">\n                            <div class=\"card-section\">\n                                 <h4>Elaine Hyshka</h4>\n                                <p>Cannabis MD</p>                            </div>\n                        </div>\n                    </div>\n                </div>\n                            <div class=\"educator p3\">\n                    <div class=\"grid-x\">\n                        <div class=\"cell small-5 photo\" style=\"background-image: url(\'http://elevation.local/assets/uploads/temp-educator-ed.jpg\')\" >\n                        </div>\n                        <div class=\"cell small-7\">\n                            <div class=\"card-section\">\n                                 <h4>Ed Rosenthal</h4>\n                                <p>Cannabis Expert</p>                            </div>\n                        </div>\n                    </div>\n                </div>\n                    </div>\n\n    </div>\n    <!-- /.sidebar -->\n\n</div>                <!-- /.cell -->\n            </div>\n            <!--/.container -->\n        </section>\n\n        <section id=\"promo\">\